<!DOCTYPE html>
<html lang="id">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1, user-scalable=1, minimum-scale=1, maximum-scale=5">
  <meta http-equiv="X-UA-Compatible" content="IE=edge">
  <title>Maafin Aku Ya</title>

  <!-- Preconnects -->
  <link rel="preconnect" href="https://fonts.googleapis.com">
  <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>

  <!-- Fonts -->
  <link href="https://fonts.googleapis.com/css2?family=Ubuntu:wght@400;700&display=swap" rel="stylesheet">

  <!-- External CSS -->
  <link href="https://maaf.feeldream.repl.co/style.css" rel="stylesheet" type="text/css">

  <!-- External JS -->
  <script src="https://cdn.jsdelivr.net/npm/sweetalert2@11.0.19/dist/sweetalert2.all.min.js"></script>
  <script src="https://kit.fontawesome.com/4f3ce16e3e.js" crossorigin="anonymous"></script>
  <script src="https://maaf.feeldream.repl.co/script.js" defer></script>

  <style>
    :root {
      --warna-bg: rgba(0, 0, 0, 0.55); 
      --warna-teks: white;
      --bingkai: 14px;
      --gaya-font: 'Ubuntu', sans-serif;
    }
  </style>
</head>
<body>
  <div id="bodyblur">
    <img id="wallpaper" src="" alt="Wallpaper" width="100%" height="100%">
    <div id="beneranblur"></div>
  </div>

  <div id="Content">
    <div>
      <marquee id="imglewat" direction="right">
        <img id="fotonimasi" src="" alt="Animasi" width="100px" height="100px">
      </marquee>
    </div>

    <p id="idgeser"></p>
    <p id="idkalimat"></p>
    <p id="idmarq">
      <marquee id="palingakhir" direction="left"></marquee>
    </p>

    <div id="contTom" style="display:none;">
      <a id="By" class='button' onClick="terima()">Mau</a>
      <b id='buttonv2'></b>
      <a id="Bn" class='button' onClick="tolak()">Gamau</a>
    </div>

    <p id="idakhir" onClick="jawab();" style="cursor:pointer;">[ Kirim Pesan ]</p>
  </div>

  <!-- JavaScript -->
  <script>
    function nongeser() {
      idgeser.style = "transform: scale(.1);opacity:0";
      fotolove.style = "opacity:1;visibility:visible;";
    }
    function showDiv() {
      setTimeout(akhiran, 300);
      document.getElementById('bodyblur').style = "opacity:.85;";
      document.getElementById('Content').style = "opacity:1;margin-top:10vh;animation:none 3s infinite;";
    }
    function showAkhir() {
      setInterval(createHeart, 200);
      document.getElementById('k2').style = "opacity:1;transform:scale(1);margin:0;";
      document.getElementById('Content').style.display = "none";
    }
    function mulaiakhir() {
      nonDiv();
      setTimeout(showAkhir, 500);
      setTimeout(finalis, 600);
    }
    function showTom() {
      document.getElementById('idkirim').style = "display:block;";
    }
    function otomatis() {
      befanimkata();
      setTimeout(animkata, 400);
      contTom.style = "display:none";
      idakhir.style = "display:flex";
      setTimeout(kirimpesan, 1200);
    }
    function befanimkata() {
      idgeser.style = "transform:scale(.01);";
      idkalimat.style = "transform:scale(.01);";
    }
    function animkata() {
      idgeser.style = "transform:scale(1);";
      idkalimat.style = "transform:scale(1);";
    }
    var aa = 0, pemb, halo, u = 0, text2, o = 0, text3, a = 0, final1, ab = 0, final2;
    pemb = halo = text2 = text3 = final1 = final2 = "";
    function finalis() {
      document.getElementById("bq").style = "opacity:1;visibility:visible;margin-top:0";
      setTimeout(showTom, 4000);
    }
    const swals = Swal.mixin({
      allowOutsideClick: false, cancelButtonColor: '#FF0040',
    });
    const swalsy = Swal.mixin({
      confirmButtonText: 'Iya', allowOutsideClick: false,
    });
    const swalst = Swal.mixin({
      allowOutsideClick: false, showConfirmButton: false, timer: 1000, timerProgressBar: true,
      didOpen: () => {
        Swal.showLoading();
        const b = Swal.getHtmlContainer().querySelector('b');
        timerInterval = setInterval(() => {
          Swal.getTimerLeft();
        }, 100);
      },
      willClose: () => {
        clearInterval(timerInterval);
      }
    });
    const swalstime = Swal.mixin({
      allowOutsideClick: false, showConfirmButton: false, timer: 2700, timerProgressBar: true,
      imageWidth: 100, imageHeight: 100,
    });
    function play() {
      var audio = new Audio('' + linkmp3);
      audio.play();
    }
    async function menuju() {
      await swals.fire('OK!', 'Kirim pesan ke WhatsApp aku, ya!', 'success');
      window.location = "https://api.whatsapp.com/send/?phone=%2B6285601482813&text&type=phone_number&app_absent=0" + pesanwhatsapp;
    }
    var akhirkata = "", akhirkataa = "";
    function aksiakhir() {
      bodyblur.style = "animation: jj 7s infinite";
      if (aa < akhirkata.length) {
        idgeser.innerHTML += akhirkata.charAt(aa);
        aa++;
        setTimeout(aksiakhir, 85);
      }
      if (aa == akhirkata.length) {
        idkalimat.style = "opacity:1;transform: scale(1);font-size:16px;margin-top:20px";
        setTimeout(showakhir, 1200);
      }
      function showakhir() {
        contTom.style = "display:flex";
      }
    }
    function showpalingakhir() {
      palingakhir.style = "opacity:1;transform: scale(1);font-size:16px;";
      setTimeout(kirimpesan, 1200);
    }
    function kirimpesan() {
      idakhir.style = "opacity:1;transform: scale(1);margin-top:60px";
    }
    async function tolakteks() {
      await swalstime.fire({ title: '' + teksnolak, timer: 1200, });
    }
    var flag = 1, flagg = 1, fungsi = 1;
    function tolak() {
      if (flagg == 1) {
        Bn.style = "margin-left:90px;transform: rotate(45deg)";
        buttonv2.style = "opacity:1;";
        By.style = "opacity:0";
        document.getElementById("buttonv2").innerHTML = tekstolak1;
        flagg = 2;
      } else if (flagg == 2) {
        Bn.style = "margin-left:95px;transform: rotate(135deg)";
        document.getElementById("buttonv2").innerHTML = tekstolak2;
        flagg = 3;
      } else if (flagg == 3) {
        Bn.style = "margin:12px 8px 12px 0;transform: rotate(0deg)";
        buttonv2.style = "opacity:0;";
        tolakteks();
        By.style = "opacity:1";
        flagg = 1;
      }
    }
    async function terima() {
      if (fungsi == 1) {
        otomatis();
        setTimeout(StartMarqueeLR, 300);
        setTimeout(showpalingakhir, 500);
        idkalimat.style = "display:none";
        idgeser.innerHTML = akhirkataa;
        idkalimat.innerHTML = akhirkataa;
        fungsi = 2;
      }
    }
  </script>

  <script type="text/javascript">
    async function jawab() {
      var { value: jawaban } = await swals.fire({
        title: 'Pesan Buat Risa',
        input: 'text',
        allowOutsideClick: false,
        showCancelButton: false,
      });
      if (jawaban && jawaban.length < 21) {
        window.jawaban = jawaban;
        pesanwhatsapp = jawaban;
        menuju();
      } else {
        await swals.fire('Ups!', 'Gabole kosong Mas Van!');
      }
    }
